- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Fairfax County Democratic Committee
    employs one full time employee, the Executive Director, whose time was more than
    25 percent devoted to federal elections and candidates during this reporting period.
    \ No other entity pays compensation for their employees to work for the Committee.
    The Committee does not engage in any fundraising on behalf of candidates for Federal
    office, so all of its reported fundraising expenses are party fundraising. The
    Committee maintains both Federal and Non Federal accounts.  The Committee is allocating
    administrative expenses using the 64% - 36% split this year.  In April 2012 the
    Committee held a fundraiser that raised both federal and nonfederal funds.  The
    fundraiser featured a Silent Auction in which a few of the Silent Auction items
    were contributed by corporations, and the proceeds from these items should have
    been deposited in the Committee?s nonfederal account.  They were mistakenly deposited
    in the Committee?s federal account.  The error was discovered as we prepared the
    May 20, 2012 report, and a corresponding transfer from our federal account to
    our nonfederal account was made in May 2012.  In May 2012 the Committee held another
    fundraising event that raised both federal and nonfederal funds, featuring a Silent
    Auction with some items donated by corporations.  The proceeds from some of these
    items were deposited first into our Federal account, because all of our credit
    card contributions are deposited into that account automatically.  On May 15,
    2012 we made a transfer from the federal account to the nonfederal account to
    correct this problem.  The first amendment added memo items that were inadvertently
    omitted to several disbursements. The second amendment reclassifies $3,522.75
    given to the Committee by Centric. The funds were not a contribution ? Centric
    took over the remaining term of the Committee?s lease of a copy machine.  Therefore
    the funds should have been reported on line 15 rather than on line 11a as they
    were in previous versions of this report.  The amendment reports the Centric funds
    properly.  This amendment also reclassifies an expense on a voter registration
    piece and an expense for a booth at a community fair as Federal Election Activity.
    \ The third amendment corrects a small error on line 11(a)(ii).\n"
